
function isOpposite(a: string, b: string) {
    return a !== b && (a === b.toLowerCase() || a.toLowerCase() === b);
}

function day5(input: string) {

    let arr = input.split('');

    let markedForDeletion = new Set<number>();

    while (true) {
        for (let i = 0; i < arr.length; ++i) {
            if (i === arr.length - 1) {
                continue;
            }
            if (isOpposite(arr[i], arr[i + 1])) {
                markedForDeletion.add(i);
                markedForDeletion.add(i + 1);
                ++i;
            }
        }

        if (markedForDeletion.size === 0) {
            break;
        }

        let newArray = new Array(arr.length - markedForDeletion.size);

        let newIdx = 0;
        for (let i = 0; i < arr.length; ++i) {
            if (!markedForDeletion.has(i)) {
                newArray[newIdx] = arr[i];
                ++newIdx;
            }
        }

        arr = newArray;
        markedForDeletion.clear();
    }

    console.log(arr.length);
}

function part2(input: string) {
    
    let fullArr = input.split('');

    let allChars = new Set<string>(fullArr.map(s => s.toLowerCase()));

    let markedForDeletion = new Set<number>();

    let shortest = Number.MAX_SAFE_INTEGER;
    let shortestChar = null;

    for (let char of allChars.values()) {
        let arr = fullArr.filter((c) => c != char && c != char.toUpperCase());

        while (true) {
            for (let i = 0; i < arr.length; ++i) {
                if (i === arr.length - 1) {
                    continue;
                }
                if (isOpposite(arr[i], arr[i + 1])) {
                    markedForDeletion.add(i);
                    markedForDeletion.add(i + 1);
                    ++i;
                }
            }

            if (markedForDeletion.size === 0) {
                break;
            }

            let newArray = new Array(arr.length - markedForDeletion.size);

            let newIdx = 0;
            for (let i = 0; i < arr.length; ++i) {
                if (!markedForDeletion.has(i)) {
                    newArray[newIdx] = arr[i];
                    ++newIdx;
                }
            }

            arr = newArray;
            markedForDeletion.clear();
        }

        if (arr.length < shortest) {
            shortest = arr.length;
            shortestChar = char;
        }
    }
    console.log(shortestChar, shortest);
}

